import React, { useState } from "react";
import "./App.css"

function EventRegistrationForm() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    event: "",
  });

  const [errors, setErrors] = useState({});
  const [submitted, setSubmitted] = useState(false);

  const validate = () => {
    const newErrors = {};
    if (!formData.name.trim()) newErrors.name = "Name is required";
    if (!formData.email.trim()) {
      newErrors.email = "Email is required";
    } else if (
      !/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i.test(formData.email)
    ) {
      newErrors.email = "Invalid email address";
    }
    if (!formData.phone.trim()) {
      newErrors.phone = "Phone number is required";
    } else if (!/^\d{10}$/.test(formData.phone)) {
      newErrors.phone = "Phone number must be 10 digits";
    }
    if (!formData.event) newErrors.event = "Please select an event";
    return newErrors;
  };

  const handleChange = (e) => {
    setFormData((prev) => ({ ...prev, [e.target.name]: e.target.value }));
    setErrors((prev) => ({ ...prev, [e.target.name]: "" }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const formErrors = validate();
    if (Object.keys(formErrors).length === 0) {
      setSubmitted(true);
    } else {
      setErrors(formErrors);
      setSubmitted(false);
    }
  };

  return (
    <div style={{ maxWidth: 400, margin: "2rem auto", fontFamily: "Arial" }}>
      <h2>Event Registration</h2>
      {submitted && (
        <div style={{ marginBottom: 15, color: "green" }}>
          Registration successful! Thank you, {formData.name}.
        </div>
      )}
      <form onSubmit={handleSubmit} noValidate>
        <div style={{ marginBottom: 10 }}>
          <label>
            Name:
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              style={{ width: "100%", padding: 8, marginTop: 4 }}
            />
          </label>
          {errors.name && (
            <div style={{ color: "red", fontSize: 12 }}>{errors.name}</div>
          )}
        </div>

        <div style={{ marginBottom: 10 }}>
          <label>
            Email:
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              style={{ width: "100%", padding: 8, marginTop: 4 }}
            />
          </label>
          {errors.email && (
            <div style={{ color: "red", fontSize: 12 }}>{errors.email}</div>
          )}
        </div>

        <div style={{ marginBottom: 10 }}>
          <label>
            Phone Number:
            <input
              type="tel"
              name="phone"
              value={formData.phone}
              onChange={handleChange}
              placeholder="1234567890"
              style={{ width: "100%", padding: 8, marginTop: 4 }}
            />
          </label>
          {errors.phone && (
            <div style={{ color: "red", fontSize: 12 }}>{errors.phone}</div>
          )}
        </div>

        <div style={{ marginBottom: 10 }}>
          <label>
            Select Event:
            <select
              name="event"
              value={formData.event}
              onChange={handleChange}
              style={{ width: "100%", padding: 8, marginTop: 4 }}
            >
              <option value="">-- Choose an event --</option>
              <option value="conference">Conference 2025</option>
              <option value="workshop">React Workshop</option>
              <option value="webinar">Webinar on AI</option>
            </select>
          </label>
          {errors.event && (
            <div style={{ color: "red", fontSize: 12 }}>{errors.event}</div>
          )}
        </div>

        <button
          type="submit"
          style={{
            backgroundColor: "#007bff",
            color: "white",
            border: "none",
            padding: "10px 15px",
            cursor: "pointer",
          }}
        >
          Register
        </button>
      </form>
    </div>
  );
}

export default EventRegistrationForm;
